      "as": "subsidized_built"
    },
    {"calculate": "datum['ABOVE MOD UNITS']", "as": "market_built"},
    {
      "calculate": "datum['RHNA VLI'] + datum['RHNA LI'] + datum['RHNA MOD']",
      "as": "subsidized_rhna"
    },
    {"calculate": "datum['RHNA ABOVE MOD']", "as": "market_rhna"},
    {
      "calculate": "datum['subsidized_built'] + datum['market_built']",
      "as": "total_built"
    },
    {
      "calculate": "datum['subsidized_rhna'] + datum['market_rhna']",
      "as": "total_rhna"
    },
    {
      "fold": [
        "subsidized_built",
        "market_built",
        "subsidized_rhna",
        "market_rhna"
      ],
      "as": ["series", "units"]
    },
    {
      "calculate": "indexof(datum.series, '_built') >= 0 ? 'Built' : 'RHNA'",
      "as": "metric"
    },
    {
      "calculate": "indexof(datum.series, 'market_') >= 0 ? 'Market-rate (Above Mod)' : 'Subsidized (VLI+LI+Mod)'",
      "as": "segment"
    }
